import React from 'react';

class SetTimer extends React.Component {

    constructor(props) {
        super(props);        

    }

    render()
    {
        return (
            <div>
                <button onClick={(e) => this.setStep(e, 'main-menu')}>Return to main menu</button>
            </div>
        );
    }
}

export default SetTimer;
